    Lidar Survey of Dauphin Island, Alabama and Chandeleur, Stake, Grand Gosier and
    Breton Islands, Louisiana, July 12-14, 2013 -- Bare Earth Digital Elevation Models
    (DEMs)",nt"tracking_summary": {ntt"total": 5,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-02-10T06:16:32.770784",nt"name":
    "topographic-lidar-survey-of-dauphin-island-alabama-and-chandeleur-stake-grand-gosier-and-breton",nt"isopen":
    false,nt"url": null,nt"notes": "A topographic lidar survey was conducted
    on July 12-14, 2013 over Dauphin Island, Alabama and Chandeleur, Stake, Grand Gosier
    and Breton Islands, Louisiana. The data were collected at a nominal pulse space
    of 1 meter (m) and processed to identify bare earth elevations. Bare earth Digital
    Elevation Models (DEMs) were generated based on these data. Photo Science, Inc.,
    was contracted by the U.S. Geological Survey (USGS) to collect and process the lidar
    data. The bare earth DEMs are 32-bit floating point ERDAS Imagine (IMG) files with
    a horizontal spatial resolution of 1-m by 1-m. They are projected to Universal Transverse
    Mercator (UTM), Zone 16, North American Datum (NAD) 1983, meters (m) coordinates.
    Their vertical datum is NAVD88 (GEOID12A) meters. Eighty-five DEMs, based on a 2-kilometer
    (km) by 2-km tiling scheme, cover the entire survey area. These lidar data are available
    to Federal, State and local governments, emergency-response officials, resource
    managers, and the general public.",nt"license_title": null,nt"extras":
